import React from 'react';
import './App.css';
import { Login1 } from './Paginas/Login1';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
          <Route path="/">
            <Login1 />
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
